	(1140152969030529024, 'FL01', '', '上传图片', '', '测试URL', 1, '开发人员', '2019-06-16 15:03:45'),
	(1140173826251550720, 'FL01', 'http://static.icode.js.cn/201906/1560933492894.jpg', '公告', '修改完成公告', '增加部分基本完成界面修改', 1, '开发人员', '2019-06-19 16:38:16'),
	(1141237681757089792, 'FL01', 'http://static.icode.js.cn/201906/1560933619503.jpg', '无头像', '', '<h1>安装python的cx_Oracle</h1>\r\n<p><br /></p>\r\n<table class="lake-table" style="width: 613px;">\r\n  <colgroup>\r\n    <col width="77">\r\n    </col>\r\n    <col width="325">\r\n    </col>\r\n    <col width="95">\r\n    </col>\r\n    <col width="115">\r\n    </col>\r\n  </colgroup>\r\n  <tbody>\r\n    <tr>\r\n      <td>\r\n        <p>版本号</p>\r\n      </td>\r\n      <td>\r\n        <p>修改条款及内容</p>\r\n      </td>\r\n      <td>\r\n        <p>修改人</p>\r\n      </td>\r\n      <td rowspan="1" style="background-color: #FFFFFF;">\r\n        <p>修改日期</p>\r\n      </td>\r\n    </tr>\r\n    <tr>\r\n      <td>\r\n        <p>1.0</p>\r\n      </td>\r\n      <td>\r\n        <p>区分Windows和CentOS下的安装</p>\r\n      </td>\r\n      <td>\r\n        <p>汪献军</p>\r\n      </td>\r\n      <td rowspan="1" style="background-color: #FFFFFF;">\r\n        <p>2019-08-04</p>\r\n      </td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n<p></p>\r\n<h1 id="039yx">一、Windows环境</h1>\r\n<h2 id="Mm9gs">1.1 pip3安装cx_Oracle</h2><pre data-lang="bash"><code>pip3 install cx_Oracle</code></pre>\r\n<p><br /></p>\r\n<h2 id="s7oDR">1.2 驱动安装</h2>\r\n<p>下载以下3个dll文件：</p>\r\n<p><a href="http://static.icode.js.cn/instantclient_11_2/oci.dll" target="_blank">http://static.icode.js.cn/instantclient_11_2/oci.dll</a></p>\r\n<p><a href="http://static.icode.js.cn/instantclient_11_2/orannzsbb11.dll" target="_blank">http://static.icode.js.cn/instantclient_11_2/orannzsbb11.dll</a></p>\r\n<p><a href="http://static.icode.js.cn/instantclient_11_2/oraociicus11.dll" target="_blank">http://static.icode.js.cn/instantclient_11_2/oraociicus11.dll</a></p>\r\n<p>将上述3个dll文件复制到[Python安装目录]\\Lib\\site-packages目录下。</p>\r\n<p><br /></p>\r\n<h1 id="KJlL6">二、CentOS环境</h1>\r\n<h2 id="xRFpP">2.1 pip3安装cx_Oracle</h2><pre data-lang="bash"><code>pip3 install cx_Oracle</code></pre>\r\n<p><br /></p>\r\n<h2 id="Qqe5W">2.2.<span> 驱动安装</span></h2>\r\n<p><span>下载以下rpm文件：</span></p>\r\n<p><a href="http://static.icode.js.cn/instantclient_11_2/oracle-instantclient18.3-basic-18.3.0.0.0-1.x86_64.rpm" target="_blank">http://static.icode.js.cn/instantclient_11_2/oracle-instantclient18.3-basic-18.3.0.0.0-1.x86_64.rpm</a></p>\r\n<p>执行以下命令：</p><pre data-lang="bash"><code>yum install oracle-instantclient18.3-basic-18.3.0.0.0-1.x86_64.rpm\r\nsh -c &quot;echo /usr/lib/oracle/18.3/client64/lib &gt; /etc/ld.so.conf.d/oracle-instantclient.conf&quot;\r\nldconfig</code></pre>\r\n<p><span style="color: #595959; background-color: #FAFAFA;"></span></p>\r\n<p>编辑/etc/profile文件，添加：</p><pre data-lang="bash"><code>export LD_LIBRARY_PATH=/usr/lib/oracle/18.3/client64/lib:$LD_LIBRARY_PATH</code></pre>\r\n<p><br /></p>\r\n<p>执行命令让环境变量生效：<span style="color: #595959; background-color: #FAFAFA;"></span></p><pre data-lang="bash"><code>source /etc/profile</code></pre>\r\n<p></p>', 2, '平台管理员', '2019-08-04 18:06:10'),
